inline bool check(int x) {
	if (x<2) return 0;
	for (int i=2,sqx=(int)sqrt(x);i<=sqx;i++) {
		if (x%i==0) return 0;
	}
	for (int i=1,j=(int)sqrt(x);i<=j;) {
		while (i*i+j*j<x) i++;
		while (i*i+j*j>x) j--;
		if (i*i+j*j==x) return 1;
	}
	return 0;
}
